window.bookSummaryJSON = "<p><b>Five months to Titan. Four brave crew members. One incredible mystery.</b></p> <p>Jeff Dolan always wanted to be an astronaut. After helping a private space company build a ship that can travel to Saturn's largest moon in five months, he gets his chance.</p> <p>Shortly after launch, a devastating malfunction forces Jeff and the crew to make a choice: continue to Titan or go back home. As the truth about their mission unravels, one thing is clear: Someone on Earth knew about the system flaw and covered it up.</p> <p>Yet surviving the journey isn't the crew's only concern. Even if they make it to Titan, they will face another problem: Something is already there.</p> <p><i>Fans of thoughtful space exploration science fiction will enjoy this near-Earth first-contact adventure. This is the first book in the Titan Chronicles, a thrilling addition to space-travel fiction.</i></p>"; 
